const Button = ({ 
    type = "primary", 
    size = "md", 
    text="Submit", 
    handleClick 
}) => {
  return (
    <button 
        onClick={handleClick}
        className={`btn btn-${type}`}
    >
        {text}
    </button>
  )
}

export default Button;
